import React, { Component } from "react";
import * as TagNames from "../constants/constants";
import axios from "axios";
// import Movies from "./movies";
import TitleBarImageList from "../common/imagelist";
// import { GetJSON } from "../common/getjson";

class Home extends Component {
  state = {
    movies: [],
  };

  async componentDidMount() {
    const { data: movies } = await axios.get(TagNames.getURL());
    // with fetchAPI -     const data = GetJSON(url);
    // console.log("URL: " + url);
    console.log(TagNames.getURL());
    console.log(movies);
    this.setState({ movies });
  }

  render() {
    const { results, length: count } = this.state.movies;
    return (
      <>
        <h1>Home</h1>
        <TitleBarImageList moviesList={results} count={count} />
        {/* <Movies moviesList={results} count={count} /> */}
      </>
    );
  }
}

export default Home;
